import React from 'react';
import { Link } from 'react-scroll';

const NavItem = ({ link }) => {
  return (
    <a href={link.path}>
      {link.display}
      <Link to={link.name} smooth={true} duration={500}></Link>
    </a>
  );
};

export default NavItem;
